import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import './styles/App.css';
import { AuthProvider } from "./contexts/AuthContext";


ReactDOM.render(
  <React.StrictMode>
    <AuthProvider>
      <App />
    </AuthProvider>,
  </React.StrictMode>,
  document.getElementById('root')
);
